//SPDX-License-Identifier: MIT
pragma solidity ^0.6.9;

import "./POOL.sol";
import "./PancakeInterface.sol";
import "./Cube.sol";
import "./BdollarInterface.sol";

contract DemoContract is Cube {
    ShareRewardPool public ShareRewardPoolInstance;
    IPancakeRouter02 public pancakerouter;
    PancakeInterface public pancakeInterfaceInstance;
    BdollarInterface public BdollarInterfaceInstance;
    POOL public PoolInstance;
    address payable PancakeInterfaceAddress;
    address payable BdollarInterfaceAddress;
    address BDO = 0x190b589cf9Fb8DDEabBFeae36a813FFb2A702454;
    address BUSD = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56;
    address WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    address private LP_Cake = 0xc5b0d73A7c0E4eaF66baBf7eE16A2096447f7aD6;
    address payable private pool;
    IBEP20 private WBNBtoken = IBEP20(WBNB);

    IBEP20 private BDOtoken = IBEP20(BDO);
    IBEP20 private BUSDtoken = IBEP20(BUSD);
    IBEP20 private LP_Caketoken = IBEP20(LP_Cake);
    address internal constant PANCAKE_ROUTER_ADDRESS =
        0x05fF2B0DB69458A0750badebc4f9e13aDd608C7F;

    constructor(address payable _pool) public payable {
        pool = _pool;
        BdollarInterfaceAddress = 0x82697a5a5605d0EdB131f40fA5e27eCFD410EC10;
        PancakeInterfaceAddress = 0x6043aaE4F36249AD130e4dB4BbB772B45C7c9834;
        pancakeInterfaceInstance = PancakeInterface(PancakeInterfaceAddress);
        BdollarInterfaceInstance = BdollarInterface(BdollarInterfaceAddress);
        PoolInstance = POOL(pool);
        admins[msg.sender] = true;
        pancakerouter = IPancakeRouter02(PANCAKE_ROUTER_ADDRESS);
    }

    function Executehalf() public payable onlyAdmin {
        PoolInstance.Invest();

        uint256 totalDeposit = WBNBtoken.balanceOf(address(this));
        WBNBtoken.transferFrom(
            address(this),
            PancakeInterfaceAddress,
            totalDeposit
        );
        require(
            WBNBtoken.balanceOf(PancakeInterfaceAddress) == totalDeposit,
            "WBNB did not pass to PancakeInterface"
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BDO
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BUSD
        );
    }

    function Executeliq() public payable {
        PoolInstance.Invest();

        uint256 totalDeposit = WBNBtoken.balanceOf(address(this));
        WBNBtoken.transferFrom(
            address(this),
            PancakeInterfaceAddress,
            totalDeposit
        );
        require(
            WBNBtoken.balanceOf(PancakeInterfaceAddress) == totalDeposit,
            "WBNB did not pass to PancakeInterface"
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BDO
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BUSD
        );
        pancakeInterfaceInstance.addPancakeliquidityPROXY(
            BDO,
            BUSD,
            BDOtoken.balanceOf(PancakeInterfaceAddress),
            BUSDtoken.balanceOf(PancakeInterfaceAddress),
            BdollarInterfaceAddress
        );
    }

    function Execute() public payable {
        PoolInstance.Invest();

        uint256 totalDeposit = WBNBtoken.balanceOf(address(this));
        WBNBtoken.transferFrom(
            address(this),
            PancakeInterfaceAddress,
            totalDeposit
        );
        
        require(
            WBNBtoken.balanceOf(PancakeInterfaceAddress) == totalDeposit,
            "WBNB did not pass to PancakeInterface"
        );

        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BDO
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BUSD
        );
        pancakeInterfaceInstance.addPancakeliquidityPROXY(
            BDO,
            BUSD,
            BDOtoken.balanceOf(PancakeInterfaceAddress),
            BUSDtoken.balanceOf(PancakeInterfaceAddress),
            BdollarInterfaceAddress
        );
        BdollarInterfaceInstance.depositToPool(
            LP_Caketoken.balanceOf(BdollarInterfaceAddress)
        );
    }

    function ExecutePOOL() public payable {
        PoolInstance.Invest();
        address payable sender = msg.sender;
        uint256 totalDeposit = WBNBtoken.balanceOf(address(this));

        WBNBtoken.transferFrom(
            address(this),
            PancakeInterfaceAddress,
            totalDeposit
        );

        // require(
        //     WBNBtoken.balanceOf(PancakeInterfaceAddress) == totalDeposit,
        //     "WBNB did not pass to PancakeInterface"
        // );

        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BDO
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BUSD
        );
        pancakeInterfaceInstance.addPancakeliquidityPROXY(
            BDO,
            BUSD,
            BDOtoken.balanceOf(PancakeInterfaceAddress),
            BUSDtoken.balanceOf(PancakeInterfaceAddress),
            BdollarInterfaceAddress
        );
        BdollarInterfaceInstance.depositToPoolPROXY(
            LP_Caketoken.balanceOf(BdollarInterfaceAddress),
            sender
        );
    }

    function investTest() public payable {
        PoolInstance.Invest();
    }

    function ExecutePROXY() public payable {
        PoolInstance.Invest();

        address payable sender = msg.sender;
        uint256 totalDeposit = WBNBtoken.balanceOf(address(this));
        WBNBtoken.transferFrom(
            address(this),
            PancakeInterfaceAddress,
            totalDeposit
        );
        require(
            WBNBtoken.balanceOf(PancakeInterfaceAddress) == totalDeposit,
            "WBNB did not pass to PancakeInterface"
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BDO
        );
        pancakeInterfaceInstance.convertTOKENAtoTOKENBKEEP(
            totalDeposit / 2,
            WBNB,
            BUSD
        );
        pancakeInterfaceInstance.addPancakeliquidityPROXY(
            BDO,
            BUSD,
            BDOtoken.balanceOf(PancakeInterfaceAddress),
            BUSDtoken.balanceOf(PancakeInterfaceAddress),
            BdollarInterfaceAddress
        );
        BdollarInterfaceInstance.depositToPoolPROXY(
            LP_Caketoken.balanceOf(BdollarInterfaceAddress),
            sender
        );
    }

    function claimTokensBDOPROXY() public payable {
        BdollarInterfaceInstance.withdrawToPoolPROXY(pool);
    }

    function setBdollarInterfaceAddress(
        address payable newBdollarInterfaceAddress
    ) public onlyAdmin {
        BdollarInterfaceAddress = newBdollarInterfaceAddress;

        BdollarInterfaceInstance = BdollarInterface(BdollarInterfaceAddress);
    }

    function setPancakeInterfaceAddress(
        address payable newPancakeInterfaceAddress
    ) public onlyAdmin {
        PancakeInterfaceAddress = newPancakeInterfaceAddress;
        pancakeInterfaceInstance = PancakeInterface(PancakeInterfaceAddress);
    }

    function setPool(address payable newPool) public {
        pool = newPool;
        PoolInstance = POOL(pool);
    }

    function getPool() public view onlyAdmin returns (address) {
        return pool;
    }
}
